import React from "react";
import photoProfil from "../images/photo-profil.jps";

const Navigation = () => {
  let ok = "photo-profil";
  return (
    <div className=" container myNavigation">
      <img scr={photoProfil} alt={ok} />
      <h1>MOUSSA MAHAMOUD</h1>
      <p>Developpeur Web</p>
    </div>
  );
};

export default Navigation;
